import React from 'react';

class App extends React.Component {
    render(){
        let re = /(login)/;
        let isAuth = re.test(this.props.location.pathname);

        return (
            <div>
               {isAuth ? undefined : "Header"}
            </div>
        );
    }
}

export default App;
